measurements.description:
Three flowers on three erect 10-cm inflorescences;

	dorsal sepal reflexed basally, slightly cupped, cream, overlaid chartreuse, 
	dark chartreuse veins basal half, cordovan mid-line extending into cream apical area;
	synsepal light chartreuse, striped dark chartreuse;
	petals undulate margins, chartruse veined and blushed cordovan, darker superior surface, hirsute basally;
	pouch light chartrause overlaid light rose;
	staminode yellow, umbo chartreuse; 

	substance medium; texture glossy.
